	add("blackcurrant", "{\"term\":\"blackcurrant\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|black|currant|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A shrub, \u0027Ribes nigrum\u0027, that produces small, very dark purple, edible berries\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1993\u0027\u0027, R. D. Davidson, \u002719: The vegetation of Lough Neagh wetlands\u0027, R.B. Wood, R.V. Smith (editors), \u0027Lough Neagh: The Ecology of a Multipurpose Water Resource\u0027, Monographae Biologicae: Volume 69, [http://books.google.com.au/books?id\u003d01Qb0J-0gxQC\u0026amp;pg\u003dPA487\u0026amp;dq\u003d%22blackcurrant%22%7C%22blackcurrants%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dPC5NUs6fEcKjlQXf2ICgBA\u0026amp;redir_esc\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22blackcurrant%22%7C%22blackcurrants%22\u0026amp;f\u003dfalse page 487\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Blackcurrant\u0027\u0027 (\u0027Ribes nigrum\u0027) and guelder rose (\u0027Viburnum opulus\u0027) are frequent but alder buckthorn (\u0027Frangula alnus\u0027) a common constituent of East Anglian carr is very rare\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"2003\u0027\u0027, European Scientific Cooperative on Phytotherapy, \u0027ESCOP Monographs: The Scientific Foundation for Herbal Medicinal Products\u0027, [http://books.google.com.au/books?id\u003dxPn-uDwUOq4C\u0026amp;pg\u003dPA426\u0026amp;dq\u003d%22blackcurrant%22%7C%22blackcurrants%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dDCtNUvTQD46dlQWbzICYDA\u0026amp;redir_esc\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22blackcurrant%22%7C%22blackcurrants%22\u0026amp;f\u003dfalse page 426\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Blackcurrant\u0027\u0027 leaf has a diuretic action [11,12,14], therefore it should not be taken concurrently with diuretics indicated for cardiac or renal insufficiency except on medical advice\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"2005\u0027\u0027, Bernard Stocks, \u0027The Teenage Pensioner\u0027, [http://books.google.com.au/books?id\u003d2voJEsfMwd0C\u0026amp;pg\u003dPA112\u0026amp;dq\u003d%22blackcurrant%22%7C%22blackcurrants%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dlDJNUqKgI4PMkAW6yoHwBg\u0026amp;redir_esc\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22blackcurrant%22%7C%22blackcurrants%22\u0026amp;f\u003dfalse page 112\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"On this first day I concentrated on bushes - gooseberry and \u0027\u0027blackcurrants\u0027\u0027 for the bottom end borders, rhododendrons for the front inside the wall and a couple of hydrangeas in the spaces left in the monoblocking to the left of the front door\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"The berry borne by this shrub\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"2003\u0027\u0027, Maria Villegas, Kay Halsey, Sarah Randell, \u0027A Little Taste of France\u0027, [http://books.google.com.au/books?id\u003dtx3ye9t6_2sC\u0026amp;pg\u003dPA120\u0026amp;dq\u003d%22blackcurrant%22%7C%22blackcurrants%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dlDJNUqKgI4PMkAW6yoHwBg\u0026amp;redir_esc\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22blackcurrant%22%7C%22blackcurrants%22\u0026amp;f\u003dfalse page 120\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"Their wines are intense and elegant, tasting of \u0027\u0027blackcurrants\u0027\u0027 and made to be aged\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"2011\u0027\u0027, Katherine Swift, \u0027The Morville Hours: The Story of a Garden\u0027, [http://books.google.com.au/books?id\u003dg2beebrASdgC\u0026amp;pg\u003dPA222\u0026amp;dq\u003d%22blackcurrant%22%7C%22blackcurrants%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dPC5NUs6fEcKjlQXf2ICgBA\u0026amp;redir_esc\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22blackcurrant%22%7C%22blackcurrants%22\u0026amp;f\u003dfalse page 222\", \"priority\":16},{\"upperType\":\"NOUN\", \"text\":\"Blackcurrant\u0027\u0027 jam is easy, but this year I have left the \u0027\u0027blackcurrants\u0027\u0027 so long that they are sweet and ripe enough to eat raw: delicious rolled in a crunch of granulated sugar\", \"priority\":17},{\"upperType\":\"NOUN\", \"text\":\"2012\u0027\u0027, Tong Kwee Lim, \u0027Edible Medicinal And Non-Medicinal Plants\u0027, Volume 4: Fruits, [http://books.google.com.au/books?id\u003dc4KuB3iGmbwC\u0026amp;pg\u003dPA28\u0026amp;dq\u003d%22blackcurrant%22%7C%22blackcurrants%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dDCtNUvTQD46dlQWbzICYDA\u0026amp;redir_esc\", \"priority\":18},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22blackcurrant%22%7C%22blackcurrants%22\u0026amp;f\u003dfalse page 28\", \"priority\":19},{\"upperType\":\"NOUN\", \"text\":\"Blackcurrants\u0027\u0027 can be eaten fresh, on its own, or with ice cream or in mixed fruit salad\", \"priority\":20}]}, \"synonyms\":{}}");

	add("blackface", "{\"term\":\"blackface\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|black|face|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A style of theatrical makeup in which a white person blackens their face in order to portray a negro\", \"priority\":1}]}, \"synonyms\":{}}");

	add("blackfellow", "{\"term\":\"blackfellow\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{compound|black|fellow|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A (male) Australian Aborigine\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1985\u0027\u0027, \u0027Illywhacker\u0027, Faber \u0026amp; Faber 2003, p. 40\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"He was squatting on the ground like a \u0027\u0027blackfellow\u0027\u0027, quiet and still and cunning\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2000\u0027\u0027, Daryl Tonkin, Carolyn Landon, \u0027Jackson\u0027s Track: Memoir of a Dreamtime Place\u0027, %22blackfellas%22+-intitle:%22blackfella|blackfellas%22+-inauthor:%22blackfella%22\u0026amp;dq\u003d%22blackfella%22|%22blackfellas%22+-intitle:%22blackfella|blackfellas%22+-inauthor:%22blackfella%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dusLxTv7yJqfMmAXA-dysAg\u0026amp;redir_esc\u003dy page 256\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"It was as if the \u0027\u0027blackfellas\u0027\u0027 were their property, and the Board could do with them as they saw fit\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2002\u0027\u0027, James Roberts, \u0027At the Bar\u0027, in Rebekah Clarkson (editor), \u0027Forked Tongues: A Delicious Anthology of Poetry and Prose\u0027, %22blackfellas%22+-intitle:%22blackfella|blackfellas%22+-inauthor:%22blackfella%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dusLxTv7yJqfMmAXA-dysAg\u0026amp;redir_esc\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"%22blackfellas%22%20-intitle%3A%22blackfella|blackfellas%22%20-inauthor%3A%22blackfella%22\u0026amp;f\u003dfalse page 29\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"A \u0027\u0027blackfella\u0027\u0027 and a whitefella are sitting at the bar. The whitefella says to the \u0027\u0027blackfella\u0027\u0027 eh boss, whadya reckon\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027blackfella\u0027\u0027 says since you ask, I consider it a metaphor of the historic case of the Coorong massacre of 1840\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"2007\u0027\u0027, Noel Olive, \u0027Enough is Enough: A History of the Pilbara Mob\u0027, %22blackfellas%22+-intitle:%22blackfella|blackfellas%22+-inauthor:%22blackfella%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dmb_xToKbM62imQWOq6yiAg\u0026amp;redir_esc\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"%22blackfellas%22%20-intitle%3A%22blackfella|blackfellas%22%20-inauthor%3A%22blackfella%22\u0026amp;f\u003dfalse page 212\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"Most police officers had no \u0027\u0027blackfella\u0027\u0027 cultural background, no knowledge of Aboriginal priorities in life, yet they were the power in the town\", \"priority\":12}]}, \"synonyms\":{}}");

	add("blackguard", "{\"term\":\"blackguard\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|black|guard|lang\u003den}}, thought to have referred originally to the scullions and lower menials of a court, or of a nobleman\u0027s household, who wore black liveries or blacked shoes and boots, or were often stained with soot.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A scoundrel; an unprincipled contemptible person; an untrustworthy person\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Macaula\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A man whose manners and sentiments are decidedly below those of his class deserves to be called a \u0027\u0027blackguard\", \"priority\":3}]}, \"synonyms\":{}}");

