	add("blackhole", "{\"term\":\"blackhole\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|black|hole|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"especially in the attributive\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A place where traffic is silently discarded\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A bit bucket; a place of permanent oblivion for data\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"DNSBL, used to block spamming IP addresses – are often called \u0026quot;blackhole lists\u0026quot\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A blackhole server, a DNS server that handles reverse lookups of invalid IP range\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"One way of fighting spam is to use a \u0027\u0027blackhole\u0027\u0027 list maintained on a \u0027\u0027blackhole\u0027\u0027 server\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"A resource sink\", \"priority\":7}]}, \"synonyms\":{}}");

