	add("blacklist", "{\"term\":\"blacklist\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{compound|black|list|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A list or collection of people or entities to be shunned or banned\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The software included a lengthy \u0027\u0027blacklist\u0027\u0027 of disreputable websites to block\", \"priority\":2}]}, \"synonyms\":{}}");

	add("blackmail", "{\"term\":\"blackmail\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"Scottish Gaelic\", \"Latin\"], \"text\":\"From \u0027black\u0027 + \u0027mail\u0027 (a piece of money) The word is variously derived from the tribute paid by English and Scottish border dwellers to Border Reivers in return for immunity from raids and other harassment. This tribute was paid in goods or labour, in Latin \u0027reditus nigri\u0027 \u0026quot;blackmail\u0026quot;; the opposite is blanche firmes or \u0027reditus albi\u0027 \u0026quot;white rent\u0026quot;, denoting payment by silver. Alternatively, McKay derives it from two Scottish gaelic words \u0027blathaich\u0027 pronounced (the \u0027th\u0027 silent) \u0027bl-aich\u0027, \u0026quot;to protect\u0026quot; and \u0027mal\u0027 (tribute, payment) He notes that the practice was common in the Highlands of Scotland as well as the Borders.More likelily, from black (adj.) + Middle English male \u0026quot;rent, tribute,\u0026quot; from Old English mal \u0026quot;lawsuit, terms, bargaining, agreement,\u0026quot; from Old Norse mal \u0026quot;speech, agreement;\u0026quot; related to Old English mæðel \u0026quot;meeting, council,\u0026quot; mæl \u0026quot;speech,\u0026quot; Gothic maþl \u0026quot;meeting place,\u0026quot; from Proto-Germanic *mathla-, from PIE *mod- \u0026quot;to meet, assemble\u0026quot; (see meet (v.)). From the practice of freebooting clan chieftains who ran protection rackets against Scottish farmers. Black from the evil of the practice. Expanded c.1826 to any type of extortion money. Compare silver mail \u0026quot;rent paid in money\u0026quot; (1590s); buttock-mail (Scottish, 1530s) \u0026quot;fine imposed for fornication.\u0026quot;\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A certain rate of money, corn, cattle, or other thing, anciently paid, in the north of England and south of Scotland, to certain men who were allied to robbers, or moss troopers, to be by them protected from pillage\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Payment of money exacted by means of intimidation; also, extortion of money from a person by threats of public accusation, exposure, or censure\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"to levy \u0027\u0027blackmail\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"to extort money by threats, as of injury to one\u0027s reputatio\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"black Black rent, or rent paid in corn, meat, or the lowest coin, as opposed to white rent, which paid in silver\", \"priority\":5}]}, \"synonyms\":{}}");

	add("blackmouth", "{\"term\":\"blackmouth\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|black|mouth|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A chinook salmon (\u0027Oncorhynchus tshawytscha\u0027), especially a juvenile\", \"priority\":1}]}, \"synonyms\":{}}");

	add("blackout", "{\"term\":\"blackout\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A temporary loss of consciousness\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A temporary loss of memory\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A large-scale power failure, and resulting loss of electricity to consumers\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"quot;The repairs at the Koeberg Power Station in the Western Cape were on schedule for completion in the third week of May. This follows huge blackouts related to the problems at the power supplier since November. \u0027Weekend Argus\u0027 May 13/14 2006 p.5\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The mandatory blocking of all light emanating from buildings as imposed during World War II\", \"priority\":5}]}, \"synonyms\":{}}");

