	add("blacksmith", "{\"term\":\"blacksmith\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|black|pos1\u003dcolor of iron|smith|pos2\u003drelated to smite|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A person who forges iron\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"c.1594–1666\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027blacksmith\u0027\u0027 may forge what he pleases\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Orion hit a rabbit once; but though sore wounded it got to the bury, and, struggling in, the arrow caught the side of the hole and was drawn out.. Ikey the \u0027\u0027blacksmith\u0027\u0027 had forged us a spearhead after a sketch from a picture of a Greek warrior; and a rake-handle served as a shaft\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A person who shoes horses; a farrier\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A blackish fish of the Pacific coast (\u0027Chromis\u0027 or \u0027Heliastes punctipinnis\", \"priority\":6}]}, \"synonyms\":{}}");

