	add("blackspeak", "{\"term\":\"blackspeak\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|black|speak|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The dialect of English spoken by people of sub-Saharan African ancestry living stateside\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1995\u0027\u0027, Robert Dawidoff, \u0026quot;The Kind of Person You Have to Sound Like to Sing \u0027Alexander\u0027s Ragtime Band\u0027\u0026quot;, in Elazar Barkan and Ronald Bush, editors, \u0027Prehistories of the Future: The Primitivist Project and the Culture of Modernism\u0027, Stanford University Press, ISBN 0804724865, page 302\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"It sounds odd to us now, but contemporary sources... suggest how the archaic \u0027\u0027blackspeak\u0027\u0027 that we associate with blackface performers had some of the aura of the later white appropriations of black speech\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2002\u0027\u0027, Joe S. Harrington, \u0027Sonic Cool: The Life \u0026amp; Death of Rock \u0027n\u0027 Roll\u0027, Hal Leonard, ISBN 0634028618, page 64\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Jordan\u0027s records were the first time many whites encountered the nuances of hip urban \u0027\u0027blackspeak\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2006\u0027\u0027, w:Robert B. Robert B. Parker, \u0027Hundred-Dollar Baby\u0027, Putnam, ISBN 0399153764, page 35\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Like Hawk, he moved easily in and out of \u0027\u0027blackspeak\u0027\u0027 as it suited him\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"quot;They is a couple of approaches to the whore business,\u0026quot; he said\", \"priority\":8}]}, \"synonyms\":{}}");

	add("blackthorn", "{\"term\":\"blackthorn\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|black|thorn|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A large shrub or small tree, \u0027Prunus spinosa\u0027, that is native to Europe, western Asia, and north Africa. It has a dark bark and bears thorns\", \"priority\":1}]}, \"synonyms\":{}}");

	add("blacktop", "{\"term\":\"blacktop\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{compound|black|top|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"asphalt Asphalt concrete or similar bituminous black paving material used for the surface of roads (e.g., tarmacadam, tarmac\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1953\u0027\u0027, \u0027The Long Goodbye\u0027, Penguin 2010, p. 284\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Then I was around the hill on the \u0027\u0027blacktop\u0027\u0027 and in another country\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A road so paved\", \"priority\":4}]}, \"synonyms\":{}}");

	add("blackwash", "{\"term\":\"blackwash\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|black|wash|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A whitewash victory for any New Zealand national sporting team\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A whitewash victory for the West Indies cricket team. Started in the 1984–86 \u0026quot;Blackwash\u0026quot; series of the West Indian cricket team in England in 1984\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A lotion made by mixing calomel and limewater\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"public campaigns and advertising funded by the coal industry to draw attention away from environmentally unsustainable practices or to justify exclusion from carbon taxes\", \"priority\":4}]}, \"synonyms\":{}}");

	add("blackwashing", "{\"term\":\"blackwashing\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The revisionist portrayal of something as belonging to a black race of people\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2008\u0027\u0027, Celeste-Marie Bernier, \u0027African American Visual Arts\u0027 (page 215\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"If Pindell opposes the \u0027whitewashing\u0027 of history, then Walker\u0027s is a revisionist \u0027\u0027blackwashing\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2013\u0027\u0027, Jonathan Scott Holloway, \u0027Jim Crow Wisdom\u0027 (page 118\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"This “\u0027\u0027blackwashing\u0027\u0027,” in Hare\u0027s opinion, was the work of black studies departments and the black faculty\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"The application of a coating of blackwash\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"1852\u0027\u0027, Frederick Overman, \u0027The Moulder\u0027s and Founder\u0027s Pocket Guide\u0027 (page 120\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027blackwashing\u0027\u0027 is here to be the very last operation, and to be well performed, and when dry must be polished by a large sleeker fitting the circle of the cylinder\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"The revisionist portrayal of something as evil\", \"priority\":9}]}, \"synonyms\":{}}");

