	add("bladder", "{\"term\":\"bladder\", \"etymology\":{\"influencers\":[], \"languages\":[\"old english (ca. 450-1100)\", \"English\", \"middle english (1100-1500)\"], \"text\":\"From Middle english (1100-1500) {{m|enm|bladder}}, {{m|enm|bledder}}, {{m|enm|bladdre}}, {{m|enm|bleddre}}, from Old english (ca. 450-1100) {{m|ang|blæddre}}, a variant of {{m|ang|blǽdre}}, {{m|ang|blēdre||blister, bladder}}, from Proto-germanic {{m|gem-pro|*bladrōn}}, {{m|gem-pro|*blēdrōn||blister, bladder}}; akin to Old High German \u0027platara\u0027 (German \u0027blatter\u0027 and Old Norse \u0027blaðra\u0027 (Danish \u0027blære\u0027 .\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A flexible sac that can expand and contract and that holds liquids or gases\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Specifically, the urinary bladder\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A hollow, inflatable organ of a plant\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The inflatable bag inside various balls used in sports, such as footballs and rugby balls\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A sealed plastic bag that contains wine and is usually packaged in a cask cask\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Anything inflated, empty, or unsound\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Rocheste\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"to swim with \u0027\u0027bladders\u0027\u0027 of philosophy\", \"priority\":8}]}, \"synonyms\":{}}");

	add("bladdernut", "{\"term\":\"bladdernut\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|bladder|nut|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"any of several species of large shrubs or small trees, of the genus , in the family \u0027Staphyleaceae\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"a species of tree with edible fruit, native to Africa\", \"priority\":2}]}, \"synonyms\":{}}");

	add("bladderpod", "{\"term\":\"bladderpod\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|bladder|pod|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any of various flowering plants, including (\u003d \u0027Isomeris arborea\u0027), , and species of \u0027Physaria\u0027 (\u003d \u0027Lesquerella\u0027) and \u0027Paysonia\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Donald W. (Hank) Nicol, \u0027Notes from the Naturalist\u0027, [http://books.google.com.au/books?id\u003dNUrAhybrbloC\u0026amp;pg\u003dPA50\u0026amp;dq\u003d%22bladderpod%22%7C%22bladderpods%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dRxKDUqyHFsWqkgWMpICgBg\u0026amp;redir_esc\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22bladderpod%22%7C%22bladderpods%22\u0026amp;f\u003dfalse page 50\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027bladderpod\u0027\u0027 (\u0027Isomeris arborea\u0027) is a pretty bush. It has loads of bright yellow flowers and the punching bag seed pods that give it its name. But, to be honest, it stinks\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"1989\u0027\u0027, Janice E. Bowers, \u0027100 Desert Wildflowers of the Southwest\u0027, [http://books.google.com.au/books?id\u003dpnw83aPB_Y4C\u0026amp;pg\u003dPT26\u0026amp;dq\u003d%22bladderpod%22%7C%22bladderpods%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dRxKDUqyHFsWqkgWMpICgBg\u0026amp;redir_esc\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22bladderpod%22%7C%22bladderpods%22\u0026amp;f\u003dfalse unnumbered page\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"As early as February, the ground between creosote bushes begins to turn yellow as masses of \u0027\u0027bladderpod\u0027\u0027\u0026lt;sup\u0026gt;[\u0027Lesquerella gordoni\u0027]\u0026lt;/sup\u0026gt; start to bloom\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"2009\u0027\u0027, Susan Van Atta, \u0027Southern California Native Flower Garden\u0027, [http://books.google.com.au/books?id\u003dteyK60IJI0oC\u0026amp;pg\u003dPA66\u0026amp;dq\u003d%22bladderpod%22%7C%22bladderpods%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dRxKDUqyHFsWqkgWMpICgBg\u0026amp;redir_esc\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22bladderpod%22%7C%22bladderpods%22\u0026amp;f\u003dfalse page 66\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"Bladderpod\u0027\u0027\u0026lt;sup\u0026gt;[\u0027Isomeris arborea\u0027]\u0026lt;/sup\u0026gt; is fast growing, and the yellow flowers and blue-green foliage are attractive in mass plantings\", \"priority\":10}]}, \"synonyms\":{}}");

	add("bladderwort", "{\"term\":\"bladderwort\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|bladder|wort|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any of many aquatic carnivorous plants, of the genus \u0027Utricularia\u0027, that have open bladders that trap minute insects and crustaceans\", \"priority\":1}]}, \"synonyms\":{}}");

