	add("blairism", "{\"term\":\"blairism\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|Blair|ism|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The political ideology attributed to the governments of British prime Prime Minister Tony Blair 1997-2007, characterised by, among other things, w:Third Way the Third Way, supporting the United States President George W Bush\", \"priority\":1}]}, \"synonyms\":{}}");

