	add("blancher", "{\"term\":\"blancher\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|blanch|er|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"One who, or that which, blanches or whitens; especially, one who anneals and cleanses money, or a chemical preparation for this purpose\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A machine for blanching or whitening\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"One who, or that which, frightens away or turns aside\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"And Gynecia, a \u0027\u0027blancher\u0027\u0027, which kept the dearest deer from her.\u0027 \u0026amp;mdash; Sir P. Sidney\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"And so even now hath he divers \u0027\u0027blanchers\u0027\u0027 belonging to the market, to let and stop the light of the gospel.\u0027 \u0026amp;mdash; Latimer\", \"priority\":5}]}, \"synonyms\":{}}");

	add("blancmange", "{\"term\":\"blancmange\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\"], \"text\":\"Old french (842-ca. 1400) \u0027blanc mangier\u0027 (\u0027white food\u0027)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A simple dessert made by cooking sweetened milk with cornstarch and vanill\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2010\u0027\u0027, Kate Jennings, \u0027Trouble: Evolution of a Radical: Selected Writings 1970-2010\u0027, page 36\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"I was a snarler. I prided myself on being a snarler. I would go to great lengths to avoid stereotypical feminine behaviour. I thought that in being outrageous or out of control, which I viewed as synonymous, I was thumbing my nose at the patriarchy. My biggest fear about AA was that I would lose my edge. Turn into \u0027\u0027blancmange\", \"priority\":3}]}, \"synonyms\":{}}");

